# Brook API

You can use this library, provided in JS and TS, just add the file to your project

## Examples
```js
const brook = new Brook(transportChannel, client); // you should fetch channel of ID 1322717023351865395

await brook.requestPayment(message.author, 1000, message.channel, 'send me your Money').catch(() => {
    // Handle errors here
});

// you can also remove `await` and use `.then`

await brook.pay(message.author, 500, message.channel);

let bal = await brook.balance(message.author);
```

## Transport
We have a private channel that only @Bot can see, called `#bot-transport`. It has ID 1322717023351865395. You can do `await client.channels.fetch('1322717023351865395')` and use that as `transportChannel`. This is where your bot will automatically send Brook API commands, but all handled automatically, with you just needing code like above example.

## Adding Bot Here
Just ask me, but you can only do that if you're adding Brook integration or it already has it.

If you plan to add integration in the future, it won't be added until you're actively working on it.

